import classes from './CarsList.module.css';

const CarsList = (props) => {

  const pickCar = (event) => {
    const [brand, model] = (event.target.textContent).split(" ");
    props.loadCar(brand,model);
  }

  console.log(props.carsList);

  const listCars = props.carsList.map((cars) => {
    return cars.map((car, pos) => {
      return (
        <li key={pos}>
          <button onClick={pickCar}>{car.brand} {car.series}</button>
        </li>
      );
    });
  });

  return (
    <div className={classes['cars-list']}>
      <ul>{listCars}</ul>
    </div>
  );
};

export default CarsList;
